INSERT INTO `gibbonUnit` (`gibbonUnitID`, `gibbonCourseID`, `name`, `active`, `description`, `tags`, `map`, `ordering`, `attachment`, `details`, `embeddable`, `license`, `sharedPublic`, `gibbonPersonIDCreator`, `gibbonPersonIDLastEdit`)
VALUES
	(0000003065,00001163,'Epic Wallpaper','Y','In this short unit students learn about graphics whilst designing their own epic wallpaper.','creativity,graphic design,ict,problem solving,technology,design','Y',0,'','<table style=\"width: 100%;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"vertical-align: top;\" colspan=\"2\"><span style=\"text-decoration: underline; font-weight: bold;\">Guiding Question</span><br /> Want To Make Some Eye Candy?</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; vertical-align: top;\"><span style=\"text-decoration: underline; font-weight: bold;\">Outcomes/Learning Objectives</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">If you use want to use Gibbon\'s Outcomes, use the outcome blocks above instead of this section.</span><br />\r\n<ul style=\"margin-top: 0px;\">\r\n<li>Learn how to use the Acorn image editing application, including the following:\r\n<ul>\r\n<li>How to remove the background from an image.</li>\r\n<li>The importance and power of layers.</li>\r\n<li>How to use filters.</li>\r\n</ul>\r\n</li>\r\n<li>Understand the difference between raster and vector images.</li>\r\n<li>Understand the differences between common raster formats, including jpg, png and gif.</li>\r\n<li>Understanding some ideas from typography, including type face, kerning and line spacing.</li>\r\n</ul>\r\n</td>\r\n<td style=\"width: 50%; vertical-align: top;\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">Differentiation</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">Differentiation by outcome or task? What will G&amp;T students be expected to do? How ill you use questioning to challenge all students? What have you done to support EAL needs?</span></p>\r\n<ul>\r\n<li>All technical terminology will be clearly explained, which will help EAL and native speakers alike.</li>\r\n<li>Questioning and discussion will be used to assess student differences, and the teacher will respond accordingly.</li>\r\n<li>Questioning and discussion will allow students to ask catch up or advance their knowledge through their own initiative.</li>\r\n<li>The teacher will work closely with students on an individual basis to ascertain and develop their understanding.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; vertical-align: top;\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">Assessment</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">What task(s) will allow students the opportunity to respond to the unit question? How will students show what they have understood? For IB, check subject guides and master assessment calendar.</span></p>\r\n<ul>\r\n<li>Wallpaper design</li>\r\n</ul>\r\n</td>\r\n<td style=\"width: 50%; vertical-align: top;\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">AfL</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">How will peer and self-assessment be used, rubrics, questioning be used to support learning? How will you deepen students\' comprehension and hit higher tier of Blooms Taxonomy?</span></p>\r\n<ul>\r\n<li>Discussion and questioning will be used throughout to assess student progress.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; vertical-align: top;\"><span style=\"text-decoration: underline; font-weight: bold;\">Activities &amp; Lessons</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">If you use want to use Gibbon\'s Smart Blocks, use the content blocks below instead of this section.</span><br />\r\n<ul>\r\n<li>See content blocks below.</li>\r\n</ul>\r\n</td>\r\n<td style=\"width: 50%; vertical-align: top;\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">Resources</span></p>\r\n<ul>\r\n<li>See content blocks below.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; vertical-align: top;\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">Interdisciplinary Links </span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">Do not try and force this. What areas of other subjects might this reflect and/discuss language. For IB, links with ToK.</span></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td style=\"width: 50%; vertical-align: top;\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">IB Learner Profile Links</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">How does the unit reflect IB Learner Profile attributes?</span></p>\r\n<ul>\r\n<li>NA</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: top;\" colspan=\"2\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">Approaches to Learning</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">How will this unit contribute to the overall development of subject-specific and general approaches to learning skills?</span></p>\r\n<ul>\r\n<li>Students will be encouraged to work independently.</li>\r\n<li>Students will be encouraged to solve their own problems.</li>\r\n<li>Students will be encouraged to experiment and try new things as they search for a solution which works for them.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: top;\" colspan=\"2\">\r\n<p><span style=\"text-decoration: underline; font-weight: bold;\">Teacher Reflection</span><br /> <span style=\"text-decoration: none; font-weight: normal; font-style: italic; font-size: 85%;\">What was successful? What needs changing? Alternative Assessments and Lesson Ideas? What other Differentiation Ideas/Plans could be used?</span></p>\r\n<ul>\r\n<li>2012-13: this unit was run as Sell A Teacher, and whilst it was successful, there was less time for it next year, so it is being shortened and re-focused.</li>\r\n<li>2014-15: this has proven to be one of the most popular units in Year 7, so it has been shifted to be the first unit of the year. Extra information on Creative Commons and Hong Kong culture have been added.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','N','',NULL,0000000001,0000000001);
INSERT INTO `gibbonUnitBlock` (`gibbonUnitBlockID`, `gibbonUnitID`, `title`, `type`, `length`, `contents`, `teachersNotes`, `sequenceNumber`, `gibbonOutcomeIDList`)
VALUES
	(000000039667,0000003065,'Want To Make Some Eye Candy?','The Pitch','5','<ul>\r\n<li>Graphic software allows us to make something out of nothing, to express our creativity.</li>\r\n<li>Do you want to learn how to make some epic wallpaper for your laptop?</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Epic Moose Wallpaper_-4kd34vi9t0b3dsi.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Epic Moose Wallpaper_-4kd34vi9t0b3dsi.png\" alt=\"\" /></a></p>','',0,''),
	(000000039668,0000003065,'Assessment','What To Expect','5','<ul>\r\n<li>At the end of this unit you will submit your wallpaper design as a PNG file, and this will be assessed.</li>\r\n<li>The focuses of this assessment will be:</li>\r\n<ul>\r\n<li>How attractive your design is.</li>\r\n<li>The quality and care reflected in your design work.</li>\r\n<li>Your use of CC.</li>\r\n<li>Your use of drop shadow and 3D effects.</li>\r\n<li>Your use of typography.</li>\r\n</ul>\r\n<li>You will receive a comment and an Approaches To Learning grade, but no Attainment grade.</li>\r\n</ul>','',1,''),
	(000000039669,0000003065,'Getting Started With Acorn','Hands On','10','<ul>\r\n<li>Acorn is software which allows you to edit graphic files.</li>\r\n<li>Can you use Spotlight to find and launch Acorn?</li>\r\n<li>Once you have launched Acorn, create a new image sized at 1680 x 1050 <span style=\"text-decoration: underline;\"><strong>pixels</strong></span> with resolution 72 <span style=\"text-decoration: underline;\"><strong>dpi</strong></span>:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Acorn New Image Window_qo6nfntkpfxmtzf.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Acorn New Image Window_qo6nfntkpfxmtzf.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Save your new file as a .acorn image.</li>\r\n</ul>','',2,''),
	(000000039670,0000003065,'Find A CC Texture','Teacher Talk & Hands On','40','<p><strong>Creative Commons</strong></p>\r\n<ul>\r\n<li>Let\'s discuss some of the following ideas:</li>\r\n<ul>\r\n<li>Is it legal to use everything we find on the Internet?</li>\r\n<li>What is copyright law?</li>\r\n<li>Who does copyright law protect?</li>\r\n<li>What are the dangers of copyright law?</li>\r\n<li>What is Creative Commons (CC)?</li>\r\n</ul>\r\n<li>If we want to a) be creative &amp; remix and b) stay out of trouble, Creative Commons gives us a huge collection of media to work with.</li>\r\n</ul>\r\n<p><strong>Your CC Texture</strong></p>\r\n<ul>\r\n<li>The foreground (front) of your wallpaper is going to be a texture (such as a wall, or some wood, or some metal).</li>\r\n<li>Can you find a <span style=\"text-decoration: underline;\"><strong>large</strong></span> (see image below for help), <span style=\"text-decoration: underline;\"><strong>Creative Commons</strong></span> licensed texture to use?</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Google Image Search Size_8bhpcqeqhdi62-k.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Google Image Search Size_8bhpcqeqhdi62-k.png\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Once you have found the texture you want, save the <span style=\"text-decoration: underline;\"><strong>largest</strong></span> version of it you can.</li>\r\n<li>Also, bookmark the link for the page holding the image, for Creative Commons attribution later on.</li>\r\n</ul>','',3,''),
	(000000039671,0000003065,'Use Your Texture','Hands On','10','<ul>\r\n<li>Now that you have saved your texture, drag the file into your Acorn image.</li>\r\n<li>You might want to <span style=\"text-decoration: underline;\"><strong>resize</strong></span> your image to fit. You can do this using Layer &gt; Rotate And Transform &gt; Scale And Rotate in the top menu bar.</li>\r\n<li>You should now have something that looks like this:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Texture In Acorn_t4xm9jhuocw5dk_6.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Texture In Acorn_t4xm9jhuocw5dk_6.png\" alt=\"\" /></a></p>','',4,''),
	(000000039672,0000003065,'Why So Big?','Discussion','5','<ul>\r\n<li>Why do you think we want to use only really large images in this project? Let\'s discuss this question as a class.</li>\r\n</ul>','',5,''),
	(000000039673,0000003065,'Layers','Teacher Talk','20','<ul>\r\n<li>I now want you to think about layers in graphics software like Acorn: I will explain the principles behind layers in graphics, so you can improve your understanding.</li>\r\n<li>Let\'s discuss why you think layers are useful?</li>\r\n<li>Do you know which file formats maintain layers?</li>\r\n<li>Did you know that in Acorn you can change the name of your layers to help keep your work organised? It can get really confusing when you have dozens of layers.</li>\r\n</ul>','',6,''),
	(000000039674,0000003065,'Finding A Silhouette','Hands On','15','<ul>\r\n<li>As part of your wallpaper, you will cut a hole in the foreground so we can see behind it.</li>\r\n<li>To do this you need to A) find a silhouette of the shape you want to cut out B) draw your own shape to cut out.</li>\r\n<li>Let\'s try option A first: please search the web to find a Creative Commons license&nbsp; of the shape you wish to cut out.</li>\r\n<li>Like with the texture, once you find the image you want, download it and also bookmark the page you found it from for your Creative Commons attribution.</li>\r\n<li>Hopefully you have something like this:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Silhouette_2jbkmii-8t5qhm-u.jpg\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Silhouette_2jbkmii-8t5qhm-u.jpg\" alt=\"\" /></a></p>','',7,''),
	(000000039675,0000003065,'Making A Cutout','Hands On','15','<ul>\r\n<li>Now we are going to use your silhouette to make a cutout in your foreground</li>\r\n<li>Drag your saved cutout file into your wallpaper image in Acorn, and then <span style=\"text-decoration: underline;\"><strong>resize</strong></span> and <span style=\"text-decoration: underline;\"><strong>position</strong></span> as desired.</li>\r\n<li>Use the <span style=\"text-decoration: underline;\"><strong>Magic Wand</strong></span> (see image below) tool and shift key, to select all the parts of you silhouette.</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Magic Wand Select Tool_jhdh997zyqqtr_s.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Magic Wand Select Tool_jhdh997zyqqtr_s.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Now make the foreground layer active:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Layer Active_pzzxc2734p5hq3zs.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Layer Active_pzzxc2734p5hq3zs.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Press the delete key to delete the silhouette shape from the foreground.</li>\r\n<li>Now right click on the layer with the silhouette and delete the layer. You should now see through your foreground into the transparent background:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Cutout_iy9qvi0hgbdx2yk2.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Cutout_iy9qvi0hgbdx2yk2.png\" alt=\"\" /></a></p>','',8,''),
	(000000039676,0000003065,'Find A Background','Hands On','15','<ul>\r\n<li>The final main part of your wallpaper will be a background that contrasts against the foreground.</li>\r\n<li>Search online to find an interesting background image available under Creative Commons.</li>\r\n<li>Remember to bookmark the page containing the image so that you can attribute it later on.</li>\r\n<li>As an example, the following image might make a good background:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Example Background_-67mh3_-bypt0xeu.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Example Background_-67mh3_-bypt0xeu.png\" alt=\"\" /></a></p>','',9,''),
	(000000039677,0000003065,'Hong Kong Style','Inspiration','15','<ul>\r\n<li>Hong Kong has its own, unique style: a result of Eastern and Western influences working side-by-side for many decades.</li>\r\n<li>If we were to create a Hong Kong-style wallpaper, what might it look like?</li>\r\n<ul>\r\n<li>Let\'s use the Think-Pair-Share thinking routine to come up with some ideas of what this might look like.</li>\r\n</ul>\r\n<li><em>I have prepared my own Epic Hong Kong Wallpaper, which is hidden in the Teacher\'s Notes.</em></li>\r\n<li style=\"text-align: left;\">We can learn about Hong Kong style using the two videos:</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"https://player.vimeo.com/video/166929892\" frameborder=\"0\" webkitallowfullscreen=\"webkitallowfullscreen\" mozallowfullscreen=\"mozallowfullscreen\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/6YosDqsWvyU\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','<p><a target=\"_blank\" style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2015/07/EpicHongKongWallpaperweb_t9ezjr52f0yxnmvw.png\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2015/07/EpicHongKongWallpaperweb_t9ezjr52f0yxnmvw.png\" /></a></p>',10,''),
	(000000039678,0000003065,'Apply Your Background','Hands On','5','<ul>\r\n<li>Now take your downloaded background, and drag it into your wallpaper image.</li>\r\n<li>In the layers view, drag the background image layer (which will be on top) and move it behind the foreground:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Layers View_kz4i9-uvyfcsupy.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Layers View_kz4i9-uvyfcsupy.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Now use the <span style=\"text-decoration: underline;\"><strong>move</strong></span> and <span style=\"text-decoration: underline;\"><strong>resize</strong></span> tools to put your background in just the right position.</li>\r\n</ul>','',11,''),
	(000000039679,0000003065,'Playtime','Hands On','15','<ul>\r\n<li>You now have some time to keep playing with your wallpaper.</li>\r\n<li>How can you improve the way your work looks?</li>\r\n</ul>','',12,''),
	(000000039680,0000003065,'Filters','Teacher Talk','20','<ul>\r\n<li>Filters are effects which you can apply to your graphics to make them look different.</li>\r\n<li>Filters can make your work more interesting, creative and original.</li>\r\n<li>Some fun filters to try include:\r\n<ul>\r\n<li>Motion blur</li>\r\n<li>Drop Shadow</li>\r\n<li>Tilt shift</li>\r\n</ul>\r\n</li>\r\n<li>Try to make your top layer active, and then apply a drop shadow. Reapply the same shadow a few times, and it will make the foreground appear to pop out from the background.</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Pop Example_qd39pijmcdfx0enj.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Pop Example_qd39pijmcdfx0enj.png\" alt=\"\" /></a></p>','',13,''),
	(000000039681,0000003065,'Playtime','Hands On','15','<ul>\r\n<li>You now have the remainder of the lesson to keep playing with your wallpaper.</li>\r\n<li>How can you improve the way your work looks?</li>\r\n</ul>','',14,''),
	(000000039682,0000003065,'Creative Commons License','Hands On','10','<ul>\r\n<li>As you are almost finished with your wallpaper, now is a good time to apply your Creative Commons License.</li>\r\n<li>Go to the <a style=\"font-weight: bold;\" href=\"http://creativecommons.org/choose\" target=\"_blank\">Creative Common License Chooser</a> and choose the license you want to use.</li>\r\n<li>Copy the license image and text to your work, and then add your attribution.</li>\r\n</ul>\r\n<hr />\r\n<p></p>\r\n<ul>\r\n<li><span style=\"background-color: #ff99cc;\"><strong>Going forward, you need to use Creative Commons for your ICT work, whenever you are</strong></span></li>\r\n<ul>\r\n<li><span style=\"background-color: #ff99cc;\"><strong>a) remixing work created by others or </strong></span></li>\r\n<li><span style=\"background-color: #ff99cc;\"><strong>b) creating work that you intend to share online</strong></span></li>\r\n</ul>\r\n</ul>','',15,''),
	(000000039683,0000003065,'Text Controls','Teacher Talk','10','<ul>\r\n<li>How much time do you spend thinking about text and font? Do you know any history?</li>\r\n</ul>\r\n<p><iframe width=\"560\" height=\"315\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"//www.youtube.com/embed/wOgIkxAfJsk\" frameborder=\"0\"></iframe></p>\r\n<ul>\r\n<li>When using Acorn, you have lots of&nbsp; control over text and how it is displayed. Some useful controls include:\r\n<ul>\r\n<li>Font type</li>\r\n<li>Kerning</li>\r\n<li>Line height</li>\r\n<li>Size</li>\r\n<li>Color</li>\r\n</ul>\r\n</li>\r\n<li>You can also get more fonts to install on your computer, from sites such as <a href=\"http://www.1001freefonts.com\">http://www.1001freefonts.com</a>.</li>\r\n<li>Can you make the text on your work look more interesting?</li>\r\n</ul>','',16,''),
	(000000039684,0000003065,'Playtime','Hands On','50','<ul>\r\n<li>You now have the remainder of the lesson to keep playing with your wallpaper.</li>\r\n<li>How can you improve the way your work looks?</li>\r\n</ul>','',17,''),
	(000000039685,0000003065,'Finish, Export & Submit','Hands On','50','<ul>\r\n<li>You now have 35 minutes to put the finishing touches on your work.</li>\r\n<li>The video below might help you if you are stuck getting your CC license set up and put into Acorn:</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0NFLmAlTDVE?rel=0\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<ul>\r\n<li>Leave enough time to save your work as a PNG file: png files can be opened by people who don\'t have Acorn, and are also smaller than Acorn files. When you save, you will lose your layers though, so keep the Acorn file as well in case you want to go back and edit some more.</li>\r\n<li>Finally, submit your work to Gibbon.</li>\r\n</ul>','',18,''),
	(000000039686,0000003065,'Raster vs. Vector','Teacher Talk','20','<ul>\r\n<li>To finish this unit, let\'s consider the ideas of <span style=\"text-decoration: underline;\"><strong>raster</strong></span> and <span style=\"text-decoration: underline;\"><strong>vector</strong></span> graphics.</li>\r\n<li>See <em>Teachers Notes</em> for details.</li>\r\n</ul>','<ul>\r\n<li>Teacher to introduce students to how graphics are represented, stored and displayed on computers.</li>\r\n<li>Most graphics programs store graphics as raster images. <br />\r\n<ul>\r\n<li>What is a raster?</li>\r\n<li>When are rasters good?</li>\r\n<li>Example raster formats? What are their strengths and weaknesses.</li>\r\n</ul>\r\n</li>\r\n<li>Some programs store graphics as vector images\r\n<ul>\r\n<li>What is a vector?</li>\r\n<li>When are vectors good?</li>\r\n<li>Example vector formats?</li>\r\n</ul>\r\n</li>\r\n<li>The Acorn file format (.acorn) uses raster for most elements, but some things (like text) are stored as vectors.</li>\r\n<li>Students should use the .acorn format whilst working on the box.</li>\r\n</ul>',19,'');
