INSERT INTO `gibbonUnitClassBlock` (`gibbonUnitClassBlockID`, `gibbonUnitClassID`, `gibbonPlannerEntryID`, `gibbonUnitBlockID`, `title`, `type`, `length`, `contents`, `teachersNotes`, `sequenceNumber`, `complete`, `gibbonOutcomeIDList`)
VALUES
	(00000000000001,000000005432,00000000000001,000000039667,'Want To Make Some Eye Candy?','The Pitch','5','<ul>\r\n<li>Graphic software allows us to make something out of nothing, to express our creativity.</li>\r\n<li>Do you want to learn how to make some epic wallpaper for your laptop?</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" target=\"_blank\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Epic Moose Wallpaper_-4kd34vi9t0b3dsi.png\"><img style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" class=\"resource\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Epic Moose Wallpaper_-4kd34vi9t0b3dsi.png\" /></a></p>','',0,'N',''),
	(00000000000002,000000005432,00000000000001,000000039668,'Assessment','What To Expect','5','<ul>\r\n<li>At the end of this unit you will submit your wallpaper design as a PNG file, and this will be assessed.</li>\r\n<li>The focuses of this assessment will be:</li>\r\n<ul>\r\n<li>How attractive your design is.</li>\r\n<li>The quality and care reflected in your design work.</li>\r\n<li>Your use of CC.</li>\r\n<li>Your use of drop shadow and 3D effects.</li>\r\n<li>Your use of typography.</li>\r\n</ul>\r\n<li>You will receive a comment and an Approaches To Learning grade, but no Attainment grade.</li>\r\n</ul>','',1,'N',''),
